import React from 'react'
import { Menu } from 'antd';
import { Image } from 'antd';
function Navbar() {
    return (
        <>
        <div stlye={logo}>
                <Image src="https://files.slack.com/files-pri/TSZCHB482-F01H75FB0UT/image.png"/>
        </div>
        <Menu style={menuStyle} width= "200px" theme="dark"mode="horizontal" defaultSelectedKeys={['1']}>
                <Menu.Item style={itemStyle}key='1'>Home</Menu.Item>
                <Menu.Item style={itemStyle} key='2'>About Us</Menu.Item>
                <Menu.Item style={itemStyle} key='3'>Contact Us</Menu.Item>
        </Menu>
        </>
    )
}

let menuStyle={
    width: '40%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '0 auto',
    height: '40px'
}

let itemStyle ={
    color: 'white',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    width: '33.33%',
    fontSize: '20px',
}

let logo = {

}

export default Navbar;
